import React, {useState, useContext} from 'react';
import Button from 'react-bootstrap/Button';
import ElegirAsiento from "./../views/ElegirAsiento";

function Asientos({item}) {
    const [select, setSelect] = useState({});

    return (<>
        <Button onClick={ () => setSelect(1) } 
        className="amarillos"
        variant="warning">1</Button>    

        <Button onClick={ () => setSelect(2) } 
        className="amarillos"
        variant="warning">2</Button> 

        <Button onClick={ () => setSelect(3) } 
        className="amarillos"
        variant="warning">3</Button> 


        
        </>
    );
}

export default Asientos;
